import React from 'react';

function Servers() {
  const servers = [
    { id: 1, name: "Server 1", licenseExpires: "2024-07-10", botAdded: true },
    { id: 2, name: "Server 2", licenseExpires: null, botAdded: false }
  ];

  return (
    <div className="page">
      <h1>Servers</h1>
      <ul>
        {servers.map(server => (
          <li key={server.id}>
            {server.name}
            {server.botAdded ? (
              server.licenseExpires ? (
                <span> - License expires on {server.licenseExpires} <button>Dashboard</button></span>
              ) : (
                <span style={{ color: 'red' }}> - License expired</span>
              )
            ) : (
              server.licenseExpires ? (
                <span> - <button>Invite bot</button></span>
              ) : (
                <span> - <a href="/license">Activate license</a></span>
              )
            )}
          </li>
        ))}
      </ul>
    </div>
  );
}

export default Servers;
